import React from "react";
import { Link } from "react-router-dom";
function Navbar() {
  return (
    <nav className="Navbar">
      <Link to="/" className="navbar-logo">
        <img src="logo.png" alt="ecilogo" />
      </Link>
    </nav>
  );
}
export default Navbar;
